INSERT INTO `faq` VALUES (1,'00003','00002','00001','To log in to the HR Staff Portal, you need to contact the Head of HR via email (head-hr@kch.mw) and request a username and password. Once you have the username and password, you can log in to the portal.','The HR Staff Portal allows employees to access their personal information, including their login information.','en',0),(2,'00004','00002','00002','The HR Staff Portal has a variety of functions, including:\n- User Rights Management to ensure data security and privacy\n- Access control, with only authorized users able to login and access data\n- Registration of users by the Head of HR\n- Email communication with the Head of HR for login and access requests','The HR Staff Portal allows authorized users to login and access data, as well as send and receive email communication with the Head of HR.','en',0),(3,'00005','00001','00003','Users who are part of the Human Resources staff in Hildesheim can get an account for the HR Staff Portal.','The HR Staff Portal is a website where employees can access their personal information, including their job history and performance reviews.','en',0),(4,'00006','00005','00004','The Car Fleet Management System functions include: \n- Tracking car repairs \n- Tracking trips \n- Tracking fuel consumption \n- Tracking services \n- Tracking driver data \n- Managing vehicles owned by KCH in the city of Hildesheim.','The text describes a car fleet management system that tracks car repairs, trips, fuel consumption, services, driver data, and vehicle ownership.','en',0);
