INSERT INTO `handbook_user` VALUES (1,'00001','00001','00001',2,2,'Purpose','Functions','Tool','Data','Employee','Tool to view, analyze and alter employee data.','The HR Staff Portal is a tool for Human Resource staff to view, analyze and alter employee data. It contains master data like name, address and age. Because of this the employee data is protected. Just staff who have an account can login and use the data.','The HR Staff Portal','en',3,'Placeholder image.',),(2,'00002','00001','00001',2,2.1,'Login','username','password','security','data privacy','Username and password provided by Head of HR.','The Hr Staff Portal has a User Rights Management for security and data privacy reasons. Access is just granted to people who have a username and password. A user is registered by the Head of HR. If you need to login and access data, please write an email to Head of HR (head-hr@kch.mw).','User Rights Management','en',5,'Placeholder image.',),(3,'00003','00001','00001',2,2.12,'Logout','button','login','sidebar menu','public computer','Logout after usage.','After using the HR Staff Portal a user should logout immediatly to avoid access through other people. To do so, there is a logout button on the left sidebar menu. On a puplic computer, it needs to be ensured that no login data is stored, so the browser data should be deleted after usage.','Logout','en',1,'Placeholder image.',),(4,'00004','00001','00001',2,2.2,'data','login','employee','personal','training','Employee personal data and training data.','The HR Staff Portal give access to employee data such as name, age and employee number. Also training data is stored in the database. Because this data lies under data privacy rules and policies the data is protected against unauthorised access through a login with a username and password.','Data privacy','en',1,'Placeholder image.',),(5,'00005','00003','00001',3,3,'Vehicles','Fuel','Repairs','Trips','Services','Tool for vehicle management.','The Car Fleet Management System is a tool to manage vehicles owned by KCH. It tracks car repairs, trips, fuel consumption, services and driver data.','The Car Fleet Management','en',3,'Car Fleet Management symbol picture.',);
INSERT INTO `handbook_user` VALUES (6,'00006','00001','00001',2,2.3,'Python','mechanisms','security','modern','programming','Security mechanisms through modern technology.','The developement of HR Staff Portal is done in Python. Python is a modern programming language with high security standards.','Security mechanisms','en',3,'Security mechanisms.',),(7,'00007','00001','00001',2,2.11,'Login','log','in','password','username','Login in the sidebar menu.','To login in the HR STaff Portal, please use the sidebar menu on the left. Enter your username and password in the fields.','Login','en',0,'Placeholder image.',),(8,'00008','00001','00001',2,2.121,'Password','locally','cache','manager','browser','Locally stored passwords.','If you are using a public computer, please ensure the password is not stored locally. Maybe you have to delete the browser / password manager cache.','Delete password locally','en',0,'Placeholder image.',),(9,'00009','00001','00001',1,1,'Description','Greetings','Welcome','Explanation','Functions','Introduction text.','This introduction covers the overall functionality and purpose of the Software system.','Description','en',0,'Introduction symbol picture.',),(10,'00010','00001','00001',2,2.12,'Logout','Security','Guideline','Safety','User','Logout security guideline.','To ensure the highest security, the user must logout after using the Software. On a public computer the user needs to delete the browser cache or password manager if the username and password was stored.','Logout','en',0,'Placeholder image.',);
/*!40000 ALTER TABLE `handbook_user` ENABLE KEYS */;
